import React from "react";
import Home from "./components/Home";
import MovieDetail from "./components/MovieDetail";
import { Switch, Route } from "react-router-dom";

const App = () => {
  return (
    <Switch>
      <Route path="/" exact>
        <Home />
      </Route>
      <Route path="/movies/:id" component={MovieDetail} />
    </Switch>
  );
};

export default App;
